import Layout from "../components/Layout";
import Link from 'next/link';
import {authInitialProps} from '../lib/auth';

export default function Index(dta){
    console.log(dta);
    return (
        <Layout title="Home" {...dta}>
            <Link href="/profile">
                <a>
                Go to Profile
                </a>
            </Link>
        </Layout>
    )
}

Index.getInitialProps = authInitialProps();
